export default function CommentList({ comments }) {
  return (
    <section>
      <h2>Comments</h2>
      {comments.map((comment) => (
        <section key={crypto.randomUUID()}>
          <h3>{comment.name}</h3>
          <p>{comment.textarea}</p>
          <p>{`My favorite animal is the ${comment.animals}${event.target.value}.`}</p>
        </section>
      ))}
    </section>
  );
}
